import React, { useState, useEffect, ReactElement } from "react";
import styled from "styled-components/native";
import { View, H1, TextInput, Button, Text } from "../../styles";
import { ScrollView } from "react-native";
import HomeCard from "./HomeCard";

const HomeDiv = styled(View)`
  flex: 1;
`;

const HomeTop = styled(View)`
  background-color: #fff;
  height: 50px;
  margin: 20px;
  flex-direction: row;
  border-bottom-width: 2px;
  border-bottom-color: #fefefe;
`;

const HomeList = styled(ScrollView)`
  flex: 1;
  padding-top: 10px;
`;

const HomeBottom = styled(View)`
  background-color: #ccc;
  height: 60px;
  flex-direction: row;
  color: #fefefe;
`;

const SearchBar = styled(TextInput)`
  background-color: #333;
  height: 100%;
  flex: 1;
  color: #fefefe;
  font-size: 1.5rem;
  padding: 5px;
`;

const NavButton = styled(View)`
  flex: 1;
`;

export default function Home(): ReactElement {
  const [loading, setLoading] = useState(false);
  const [rooms, setRooms] = useState([]);

  useEffect(() => {
    const getdata = async () => {
      const raw = await fetch("http://localhost:8000/rooms");
      const data = await raw.json();
      console.log(data);
    };

    getdata();
  }, []);

  return (
    <HomeDiv>
      <HomeTop>
        {/* <FontAwesome.Button
          name="search"
          size={32}
          color="#fefefe"
          backgroundColor="#333"
        /> */}
        <SearchBar placeholder="Search" />
      </HomeTop>

      <HomeList>
        <HomeCard></HomeCard>
      </HomeList>
      <HomeBottom>
        <NavButton>Chat</NavButton>
        <NavButton>Profile</NavButton>
      </HomeBottom>
    </HomeDiv>
  );
}
